package com.amandris.clients.web.view;import org.apache.struts.action.ActionForm;public class StateView extends ActionForm{	private String 	id;	private String 	text;	private String 	name;	private String 	countryId;	private String 	countryText;		private static final long serialVersionUID = 1526471155622776013L;		public StateView()	{		id 			= "";		text 		= "";		name		= "";		countryId 	= "";		countryText = "";	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getText() {		return text;	}	public void setText(String text) {		this.text = text;	}	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getCountryId() {		return countryId;	}	public void setCountryId(String countryId) {		this.countryId = countryId;	}	public String getCountryText() {		return countryText;	}	public void setCountryText(String countryText) {		this.countryText = countryText;	}			}